webpackJsonp([93347601981948],{1958:function(e,t){e.exports={data:{postBySlug:{html:'<p>GraphQL is a new technology and the community is growing rapidly.\nThis is just my journey into GraphQL+OracleDB and is not a definitive guide. </p>\n<p>I highly encourage you to take one of your own! Here are a few good places to start</p>\n<h3 id="graphql"><a href="#graphql" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>GraphQL</h3>\n<p>The graphql-community-endorsed guide to GraphQL<br>\n<a href="https://www.howtographql.com/">https://www.howtographql.com/</a> </p>\n<p>Others trying to Connect oracle+graphql on GitHub\n*Note: I originally picked this topic for my Dev Talk because I thought it had never been done before.\nWhile that may have been true at the time it looks like a few others have followed suit!<br>\n<a href="https://github.com/danilohgds/graphql-oracle">https://github.com/danilohgds/graphql-oracle</a><br>\n<a href="https://github.com/santosh9991/flask-oracle-graphQL">https://github.com/santosh9991/flask-oracle-graphQL</a>  </p>\n<h3 id="oracle-database"><a href="#oracle-database" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Oracle Database</h3>\n<p>Query Oracle DB 18c in your browser. Learn &#x26; share SQL for free.<br>\n<a href="https://livesql.oracle.com">https://livesql.oracle.com</a> </p>\n<p>One of the best cloud services I\'ve dealt with (also pays my bills)<br>\n<a href="https://cloud.oracle.com/en_US/database">https://cloud.oracle.com/en_US/database</a>   </p>\n<p>(unrelated to Oracle\'s DB) Currently I think our best service is<br>\n<a href="https://cloud.oracle.com/en_US/big-data-cloud">https://cloud.oracle.com/en_US/big-data-cloud</a><br>\nBecause in my opinion it\'s the most fun :) </p>\n<p><a href="https://github.com/oracle/learning-library/tree/master/workshops/dbcs">https://github.com/oracle/learning-library/tree/master/workshops/dbcs</a></p>\n<p><a href="https://github.com/oracle/learning-library/tree/master/workshops/dbcs-dba-oci">https://github.com/oracle/learning-library/tree/master/workshops/dbcs-dba-oci</a> </p>\n<p><a href="https://github.com/oracle/learning-library/tree/master/workshops/dbcs-dba">https://github.com/oracle/learning-library/tree/master/workshops/dbcs-dba</a> </p>\n<h3 id="containers-and-cicd"><a href="#containers-and-cicd" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Containers and CI/CD</h3>\n<p>This is a great workshop a friend of mine recently wrote!<br>\n<a href="https://oracle.github.io/learning-library/workshops/container-native-development/">https://oracle.github.io/learning-library/workshops/container-native-development/</a> </p>\n<p>An Oracle-endorsed repository full of Docker images<br>\n<a href="https://github.com/oracle/docker-images">https://github.com/oracle/docker-images</a> </p>\n<h3 id="this-site"><a href="#this-site" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>This Site</h3>\n<p>Site was made with <a href="https://www.gatsbyjs.org/">Gatsby</a>, a static-site generator built with GraphQL and\na modern JavaScript stack. My Personal Favorite static-site generator is <a href="https://gohugo.io/">Hugo</a>,\nwhich I use to build my personal site <a href="https://sblack4.github.io">https://sblack4.github.io</a></p>',timeToRead:2,excerpt:"GraphQL is a new technology and the community is growing rapidly. \nThis is just my journey into GraphQL+OracleDB and is not a definitiveâ€¦",frontmatter:{title:"Learn More"}},tableOfContents:{chapters:[{title:"Overview",entries:[{entry:{childMarkdownRemark:{fields:{slug:"/overview"},frontmatter:{title:"Overview"}}}}]},{title:"Running the Demo",entries:[{entry:{childMarkdownRemark:{fields:{slug:"/running-the-demo"},frontmatter:{title:"Running the Demo"}}}},{entry:{childMarkdownRemark:{fields:{slug:"/running-in-the-cloud"},frontmatter:{title:"Running in the Cloud"}}}},{entry:{childMarkdownRemark:{fields:{slug:"/running-with-docker"},frontmatter:{title:"Running with Docker"}}}}]},{title:"GraphQL & Oracle DB?",entries:[{entry:{childMarkdownRemark:{fields:{slug:"/about-graph-ql"},frontmatter:{title:"About GraphQL"}}}},{entry:{childMarkdownRemark:{fields:{slug:"/about-oracle-db"},frontmatter:{title:"About Oracle DB"}}}},{entry:{childMarkdownRemark:{fields:{slug:"/oracle-db-and-graph-ql"},frontmatter:{title:"OracleDB and GraphQL"}}}}]},{title:"Learn More",entries:[{entry:{childMarkdownRemark:{fields:{slug:"/learn-more"},frontmatter:{title:"Learn More"}}}}]},{title:"Summary",entries:[{entry:{childMarkdownRemark:{fields:{slug:"/summary"},frontmatter:{title:"Summary"}}}},{entry:{childMarkdownRemark:{fields:{slug:"/references"},frontmatter:{title:"References"}}}}]}]}},pathContext:{slug:"/learn-more"}}}});
